import React from "react";
import Navbar from './E-commerce-website/Navbar';
import Slider from './E-commerce-website/Slider';
import Services from "./E-commerce-website/Services";
import Ecommain from "./E-commerce-website/Ecommain";
import Products from "./E-commerce-website/Products";
import Footer from "./E-commerce-website/Footer";


function Myapp(){


    return(
            <>
              <Navbar/>
              <Slider/>
              <Services/>
              <Ecommain/>
              <Products/>
              <Footer/>

     </>
    );

}
export default Myapp;


